const pickOptionsByPlayer = Object.values(PICK_6_RESPONSE.playerDkIdToPlayerPickMap).map(obj => {
    return Object.values(obj.statLines).map(stat => ({
        name: obj.playerDetail.displayName,
        team: obj.playerDetail.team.abbreviation,
        opponent: obj.playerDetail.team.abbreviation === obj.competitions[0].homeTeam.abbreviation ? obj.competitions[0].awayTeam.abbreviation : obj.competitions[0].homeTeam.abbreviation,
        stat: stat.statCategory.name,
        overUnder: stat.targetValue,
    }));
});
const pickOptions = pickOptionsByPlayer.reduce((acc, cv) => [...acc, ...cv], []);
console.log({ pickOptions });

const BATTER_PROPS = new Set(['Hits', 'Runs', 'Singles', 'Walks', 'Total Bases (From Hits)', 'Strikeouts']);
const PITCHER_PROPS = new Set(['Earned Runs Allowed', 'Hits Against', 'Walks Allowed', 'Strikeouts Thrown', 'Outs'])

// AUDIT LINE TO MAKE SURE I HAVE EVERYTHING
pickOptions.forEach(p => console.log(BATTER_PROPS.has(p.stat) || PITCHER_PROPS.has(p.stat)));

const groupedPickOptions = pickOptions.reduce((acc, cv) => {
    const BATTER_OR_PITCHER_STAT = BATTER_PROPS.has(cv.stat) ? 'B' : 'P';
    if (!acc[BATTER_OR_PITCHER_STAT][cv.team]) {
        acc[BATTER_OR_PITCHER_STAT][cv.team] = {};
    }
    if (!acc[BATTER_OR_PITCHER_STAT][cv.team][cv.name]) {
        acc[BATTER_OR_PITCHER_STAT][cv.team][cv.name] = [];
    }

    acc[BATTER_OR_PITCHER_STAT][cv.team][cv.name].push(cv);
    return acc;
}, { 'B': {}, 'P': {} })

console.log({ groupedPickOptions });